INSERT INTO `recipes` (`id`, `title`, `category`, `subcategory`, `description`, `ingredients`, `instructions`, `image`, `prep_time`, `cook_time`, `servings`, `difficulty`, `author_id`, `is_draft`, `visibility`, `created_at`, `updated_at`) VALUES
(1, 'Bacalhau ?? Br??s', 'Prato Principal', 'Peixe', 'Um dos pratos mais emblem??ticos da gastronomia portuguesa, o Bacalhau ?? Br??s combina bacalhau desfiado, batata palha e ovos num refogado delicioso.', '400g de bacalhau demolhado\n300g de batata palha\n6 ovos\n2 cebolas grandes\n3 dentes de alho\n4 colheres de sopa de azeite\nAzeitonas pretas a gosto\nSalsa fresca\nSal e pimenta q.b.', '1. Demolhe o bacalhau durante 24-48h, trocando a ??gua v??rias vezes\n2. Coza o bacalhau em ??gua fervente por 5 minutos\n3. Escorra, deixe arrefecer e desfie, removendo peles e espinhas\n4. Corte a cebola em meias-luas finas e pique o alho\n5. Numa frigideira grande, aque??a o azeite e refogue a cebola at?? ficar transparente\n6. Adicione o alho e refogue por 1 minuto\n7. Junte o bacalhau desfiado e misture bem\n8. Adicione a batata palha e envolva delicadamente\n9. Bata os ovos ligeiramente e adicione ?? frigideira\n10. Mexa continuamente at?? os ovos ficarem cremosos\n11. Tempere com sal e pimenta\n12. Sirva decorado com azeitonas pretas e salsa picada', 'data:image/jpeg;base64,', 30, 20, 4, '', 1, 0, 'public', '2025-12-03 09:22:36', '2025-12-03 10:01:04');
INSERT INTO `recipes` (`id`, `title`, `category`, `subcategory`, `description`, `ingredients`, `instructions`, `image`, `prep_time`, `cook_time`, `servings`, `difficulty`, `author_id`, `is_draft`, `visibility`, `created_at`, `updated_at`) VALUES
(2, 'Caldo Verde', 'Entrada', 'Vegetarianas', 'Sopa tradicional portuguesa, origin??ria do Minho, feita com couve galega, batata e chouri??o. Perfeita para os dias frios.', '1kg de batatas\r\n500g de couve galega\r\n1 chouriço\r\n1 cebola\r\n2 dentes de alho\r\n4 colheres de sopa de azeite\r\nSal q.b.\r\n2 litros de água', '1. Descasque e corte as batatas em pedaços\r\n2. Numa panela grande, aqueça o azeite e refogue a cebola picada\r\n3. Adicione o alho esmagado e refogue por 1 minuto\r\n4. Junte as batatas e a água, tempere com sal\r\n5. Deixe cozer até as batatas estarem muito macias (cerca de 20 min)\r\n6. Triture as batatas com a varinha mágica até obter um puré\r\n7. Lave a couve, retire os talos e corte em juliana muito fina\r\n8. Adicione a couve ao caldo e coza por 5 minutos\r\n9. Corte o chouriço em rodelas finas e frite à parte\r\n10. Sirva o caldo bem quente com as rodelas de chouriço e um fio de azeite', 'data:image/jpeg;base64,', 15, 30, 6, '', 1, 0, 'public', '2025-12-03 09:22:36', '2025-12-10 08:52:09');
INSERT INTO `recipes` (`id`, `title`, `category`, `subcategory`, `description`, `ingredients`, `instructions`, `image`, `prep_time`, `cook_time`, `servings`, `difficulty`, `author_id`, `is_draft`, `visibility`, `created_at`, `updated_at`) VALUES
(3, 'Arroz de Marisco', 'Prato Principal', 'Peixe', 'Rico arroz caldoso repleto de mariscos frescos, com um sabor intenso do mar. Uma verdadeira del??cia da costa portuguesa.', '400g de arroz\n500g de gambas\n500g de am??ijoas\n500g de mexilh??o\n300g de lulas\n2 tomates maduros\n1 cebola\n4 dentes de alho\n1 pimento vermelho\n200ml de vinho branco\n1.5L de caldo de peixe\n1 molho de coentros\n5 colheres de sopa de azeite\nSal, pimenta e colorau q.b.', '1. Limpe todos os mariscos, deixe as am??ijoas em ??gua com sal por 1 hora\n2. Corte as lulas em argolas\n3. Prepare um refogado com azeite, cebola, alho e pimento\n4. Adicione o tomate ralado e deixe refogar bem\n5. Junte o colorau e as lulas, refogando por 5 minutos\n6. Adicione o vinho branco e deixe evaporar\n7. Acrescente o arroz e envolva no refogado\n8. Adicione o caldo quente aos poucos, mexendo\n9. A meio da cozedura, adicione as gambas e os mexilh??es\n10. Por ??ltimo, adicione as am??ijoas\n11. Cozinhe at?? o arroz ficar cremoso e os mariscos abrirem\n12. Polvilhe coentros picados e deixe repousar 5 minutos', 'data:image/jpeg;base64,', 40, 35, 6, '', 1, 0, 'public', '2025-12-03 09:22:36', '2025-12-03 10:00:27');
INSERT INTO `recipes` (`id`, `title`, `category`, `subcategory`, `description`, `ingredients`, `instructions`, `image`, `prep_time`, `cook_time`, `servings`, `difficulty`, `author_id`, `is_draft`, `visibility`, `created_at`, `updated_at`) VALUES
(4, 'Past??is de Nata', 'Sobremesa', 'Quentes', 'Os famosos Past??is de Bel??m, com massa folhada crocante e recheio cremoso de nata. Um ??cone da do??aria portuguesa.', '1 rolo de massa folhada (300g)\n6 gemas de ovo\n200g de a????car\n2 colheres de sopa de farinha Maizena\n300ml de leite\n200ml de nata\n1 pau de canela\nCasca de 1 lim??o\n1 colher de ch?? de baunilha\nCanela em p?? para decorar', '1. Pr??-aque??a o forno a 250??C\n2. Numa panela, misture o a????car, a farinha e um pouco de leite frio\n3. Adicione o resto do leite, a nata, a canela e a casca de lim??o\n4. Leve ao lume m??dio, mexendo sempre at?? engrossar\n5. Retire do lume, remova a canela e o lim??o, deixe arrefecer\n6. Adicione as gemas e a baunilha, mexendo bem\n7. Estenda a massa folhada e corte c??rculos\n8. Forre formas de empadas untadas com manteiga\n9. Encha 2/3 de cada forma com o creme\n10. Leve ao forno bem quente por 15-20 minutos at?? caramelizar\n11. Retire e deixe arrefecer\n12. Polvilhe com canela em p??', 'data:image/jpeg;base64,', 30, 20, 12, '', 1, 0, 'public', '2025-12-03 09:22:36', '2025-12-03 10:01:45');
INSERT INTO `recipes` (`id`, `title`, `category`, `subcategory`, `description`, `ingredients`, `instructions`, `image`, `prep_time`, `cook_time`, `servings`, `difficulty`, `author_id`, `is_draft`, `visibility`, `created_at`, `updated_at`) VALUES
(5, 'Francesinha', 'Prato Principal', 'Carne', 'Prato t??pico do Porto, um verdadeiro desafio gastron??mico: bife, lingui??a, salsicha e fiambre, coberto com queijo derretido e molho especial.', '8 fatias de p??o de forma\n4 bifes de vaca (150g cada)\n4 lingui??as frescas\n4 salsichas frescas\n8 fatias de fiambre\n200g de queijo flamengo fatiado\n4 ovos\n200ml de molho de tomate\n200ml de cerveja\n300ml de caldo de carne\n1 colher de sopa de mostarda\nPiri-piri a gosto\n1 folha de louro\nManteiga, sal e pimenta q.b.', '1. Prepare o molho: numa panela, derreta manteiga e adicione molho de tomate\n2. Acrescente a cerveja, caldo de carne, mostarda, piri-piri e louro\n3. Deixe ferver e reduza por 15 minutos, tempere\n4. Grelhe os bifes, lingui??as e salsichas\n5. Torre ligeiramente as fatias de p??o\n6. Monte: p??o, fiambre, bife, lingui??a, salsicha, fiambre, p??o\n7. Cubra com queijo fatiado generosamente\n8. Leve ao forno at?? o queijo derreter\n9. Frite os ovos estrelados\n10. Coloque a francesinha no prato, cubra com molho quente\n11. Coloque o ovo estrelado por cima\n12. Sirva com batatas fritas', 'data:image/jpeg;base64,', 30, 30, 4, '', 1, 0, 'public', '2025-12-03 09:22:36', '2025-12-03 10:03:19');
INSERT INTO `recipes` (`id`, `title`, `category`, `subcategory`, `description`, `ingredients`, `instructions`, `image`, `prep_time`, `cook_time`, `servings`, `difficulty`, `author_id`, `is_draft`, `visibility`, `created_at`, `updated_at`) VALUES
(6, 'Polvo ?? Lagareiro', 'Prato Principal', 'Peixe', 'Polvo cozido e grelhado, acompanhado de batatas a murro e regado com azeite. Simples e delicioso.', '1kg de polvo (limpo)\n1kg de batatas pequenas\n8 dentes de alho\n200ml de azeite virgem extra\nSal grosso\nPimenta preta\n2 folhas de louro\nCoentros frescos a gosto', '1. Bata o polvo para amaciar ou congele e descongele\n2. Numa panela grande, ferva ??gua com louro e sal\n3. Mergulhe o polvo 3 vezes na ??gua fervente\n4. Deixe cozer em lume brando por 40-50 minutos\n5. Coza as batatas com pele em ??gua com sal\n6. Escorra o polvo e corte em peda??os\n7. Numa frigideira bem quente, grelhe o polvo at?? dourar\n8. Esmague as batatas cozidas (batatas a murro) e grelhe\n9. Aque??a bastante azeite com alho em l??minas\n10. Disponha o polvo e as batatas num prato\n11. Regue generosamente com o azeite de alho a ferver\n12. Tempere com sal grosso, pimenta e coentros', 'data:image/jpeg;base64,', 20, 60, 4, '', 1, 0, 'public', '2025-12-03 09:22:36', '2025-12-03 10:03:45');
INSERT INTO `recipes` (`id`, `title`, `category`, `subcategory`, `description`, `ingredients`, `instructions`, `image`, `prep_time`, `cook_time`, `servings`, `difficulty`, `author_id`, `is_draft`, `visibility`, `created_at`, `updated_at`) VALUES
(7, 'A??orda Alentejana', 'Prato Principal', 'Vegetarianos', 'Prato tradicional alentejano, feito com p??o, alho, coentros e ovos escalfados. Confortante e saboroso.', '400g de p??o alentejano (duro)\n4 ovos\n6 dentes de alho\n1 molho grande de coentros\n100ml de azeite virgem extra\nSal q.b.\n800ml de ??gua quente\n2 colheres de sopa de vinagre', '1. Corte o p??o em fatias ou peda??os pequenos\n2. Num almofariz, esmague o alho com sal at?? formar uma pasta\n3. Adicione os coentros picados e continue a esmagar\n4. Coloque o p??o numa tigela ou terrina\n5. Misture a pasta de alho e coentros com ??gua quente\n6. Despeje sobre o p??o e deixe embeber\n7. Adicione o azeite e envolva bem\n8. Numa panela, ferva ??gua com vinagre\n9. Escalde os ovos at?? a clara estar cozida mas a gema mole\n10. Sirva a a??orda em pratos fundos\n11. Coloque um ovo escalfado sobre cada por????o\n12. Regue com um fio de azeite', 'data:image/png;base64,', 15, 10, 4, '', 1, 0, 'public', '2025-12-03 09:22:36', '2025-12-03 10:04:30');
INSERT INTO `recipes` (`id`, `title`, `category`, `subcategory`, `description`, `ingredients`, `instructions`, `image`, `prep_time`, `cook_time`, `servings`, `difficulty`, `author_id`, `is_draft`, `visibility`, `created_at`, `updated_at`) VALUES
(8, 'Arroz Doce', 'Sobremesa', 'Frias', 'Sobremesa tradicional portuguesa cremosa, aromatizada com lim??o e canela. Presente em todas as festas e celebra????es.', '200g de arroz carolino\n1 litro de leite\n200g de a????car\n4 gemas de ovo\nCasca de 1 lim??o grande\n1 pau de canela\n1 pitada de sal\nCanela em p?? para decorar', '1. Numa panela, ferva ??gua com sal, casca de lim??o e pau de canela\n2. Adicione o arroz e cozinhe por 5 minutos, escorra\n3. Adicione o leite ao arroz e cozinhe em lume brando, mexendo\n4. Quando o arroz estiver macio, adicione o a????car\n5. Continue cozinhando at?? ficar cremoso\n6. Bata as gemas ligeiramente\n7. Retire um pouco do arroz quente e misture com as gemas\n8. Adicione as gemas ao arroz, mexendo rapidamente\n9. Cozinhe por mais 2-3 minutos sem ferver\n10. Retire a casca de lim??o e o pau de canela\n11. Distribua por ta??as ou numa travessa\n12. Deixe arrefecer e decore com canela em p??\n13. Leve ao frigor??fico at?? servir', 'data:image/jpeg;base64,', 10, 40, 8, '', 1, 0, 'public', '2025-12-03 09:22:36', '2025-12-03 10:06:11');

